import React from "react";
import { Row, Col } from "antd";
import LoginForm from "../../components/LoginForm";
import {
  GlobalContainer,
  ContentContainer,
  ContentBox,
  ImageSection,
  Image,
  LoginBox,
} from "./styles";
import CampusImage from "../../static/img/first_bg_round_real.png";

const login = () => {
  return (
    <GlobalContainer>
      <ContentContainer>
        <Row>
          <Col xs={24} md={12}>
            <ContentBox>
              <TitleSection>
                <Logo></Logo>
                
              </TitleSection>
              <ImageSection className="forth-box_flow">
                <Image src={CampusImage} alt="campusImage" />
              </ImageSection>

              <div></div>
            </ContentBox>
          </Col>
          <Col xs={24} md={12}>
            <LoginBox>
              <LoginForm />
            </LoginBox>
          </Col>
        </Row>
      </ContentContainer>
      {/* <Footer>

      </Footer> */}
    </GlobalContainer>

    /* <Row gutter={8}>
        <Col xs={24} md={6} />
        <Col xs={24} md={12}>
          <LoginForm />
        </Col>
        <Col xs={24} md={6} />
      </Row> */
  );
};

export default login;
